import React from 'react';
import { Box, Typography } from '@mui/material';

const PortfolioTitle = () => {
  return (
    <Box sx={{ textAlign: 'center', backgroundColor: '#007F8D', py: 5, display: 'flex', flexDirection: 'row', alignItems: 'center' }}>
      <Box sx={{ borderRadius: '50%', overflow: 'hidden', marginRight: 3, flexShrink: 0, width: '200px', height: '200px' }}>
        <img src="/images/perfil.jpg" alt="Mi foto de perfil" width="100%" height="100%" style={{ objectFit: 'cover' }} />
      </Box>
      <Box sx={{ flexGrow: 1 }}>
        <Typography variant="h3" component="h1" sx={{ color: '#fff', fontFamily: 'Roboto', fontWeight: 700, marginBottom: 1 }}>
          Ramiro Slullitel
        </Typography>
        <Typography variant="h5" component="h2" sx={{ color: '#fff', fontFamily: 'Roboto', fontWeight: 400, marginBottom: 2 }}>
          Desarrollador web
        </Typography>
        <Typography variant="h6" component="div" sx={{ color: '#fff', fontFamily: 'Roboto', fontWeight: 400 }}>
          Bienvenidos a mi portfolio web
        </Typography>
      </Box>
    </Box>
  );
};

export default PortfolioTitle;
